public Log4j2Impl(String clazz) {
    Logger logger = LogManager.getLogger(clazz);
    if (logger instanceof AbstractLogger) {
        log = new Log4j2AbstractLoggerImpl(((AbstractLogger) (logger)));
    } else {
        log = new Log4j2LoggerImpl(logger);
    }
}

